column8:
キッチンのタイル・ステンレス製壁面に貼り、油汚れ等から守る。<br>３枚貼り合わせてあるので、汚れたら１枚づつはがして使え経済的。<br><br><br>CS：40<p>ＪＡＮ　4901987228547 </p><p>●汚れたらはがせて使える3回分の壁面シート<br>●透明シートを3枚張り合わせた状態になっていますので、汚れたら表面から1枚ずつはがせ、経済的です。<br>●透明性のよいシートと粘着剤を使用していますので、キッチン壁面の美しさを活かしながら保護・維持します。<br><br>【規格概要】<br>商品サイズ・・・タテ45cm*ヨコ90cm<br>付属品・・・ヘラ1コ<br>材質・・・ポリエステルフィルム<br><br>【注意事項】<br>・素焼きのタイル、デザインタイル、壁紙、木製、土壁等のザラザラ面やデコボコ面、化粧合板には使えません。<br>・火が直接当たるところや熱のかかるところへのご使用は絶対におやめください。<br>・ステンレス等金属製で、かつ水平な状態の場所(ワークトップや調理台等)には貼らないでください。金属部分が変色する恐れがあります。<br>・割れる恐れがありますので、窓ガラスには使わないでください。<br>・完全に粘着するまでに約1日かかります。<br>・1年をめどにお取替えください。長期間経過してはがすと、粘着剤の跡が残こともあります。<br>・万一、粘着面が壁面に残った倍は、中性洗剤で拭き取ってください。<br><br>東洋アルミエコープロダクツ<br>541-0053 大阪府大阪市中央区本町2-1-6<br>0120-123-701</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
